var progressx = function (cell, formatterParams, onRendered) {
  //progress bar
  var value = this.sanitizeHTML(cell.getValue() / 10) || 0,
    element = cell.getElement(),
    max = formatterParams && formatterParams.max ? formatterParams.max : 100,
    min = formatterParams && formatterParams.min ? formatterParams.min : 0,
    legendAlign =
      formatterParams && formatterParams.legendAlign
        ? formatterParams.legendAlign
        : "center",
    percent,
    percentValue,
    color,
    legend,
    legendColor,
    top,
    left,
    right,
    bottom;

  //make sure value is in range
  percentValue = parseFloat(value) <= max ? parseFloat(value) : max;
  percentValue =
    parseFloat(percentValue) >= min ? parseFloat(percentValue) : min;

  //workout percentage
  percent = (max - min) / 100;
  percentValue = Math.round((percentValue - min) / percent);

  //set bar color
  switch (typeof formatterParams.color) {
    case "string":
      color = formatterParams.color;
      break;
    case "function":
      console.log(value);
      color = formatterParams.color(value);
      break;
    case "object":
      console.log("sex");
      if (Array.isArray(formatterParams.color)) {
        var unit = 100 / formatterParams.color.length;
        var index = Math.floor(percentValue / unit);

        index = Math.min(index, formatterParams.color.length - 1);
        index = Math.max(index, 0);
        color = formatterParams.color[index];
        break;
      }
    default:
      color = "#2DC214";
  }

  //generate legend
  switch (typeof formatterParams.legend) {
    case "string":
      legend = formatterParams.legend;
      break;
    case "function":
      legend = formatterParams.legend(value);
      break;
    case "boolean":
      legend = value;
      break;
    default:
      legend = false;
  }

  //set legend color
  switch (typeof formatterParams.legendColor) {
    case "string":
      legendColor = formatterParams.legendColor;
      break;
    case "function":
      legendColor = formatterParams.legendColor(value);
      break;
    case "object":
      if (Array.isArray(formatterParams.legendColor)) {
        var unit = 100 / formatterParams.legendColor.length;
        var index = Math.floor(percentValue / unit);

        index = Math.min(index, formatterParams.legendColor.length - 1);
        index = Math.max(index, 0);
        legendColor = formatterParams.legendColor[index];
      }
      break;
    default:
      legendColor = "#000";
  }

  element.style.minWidth = "30px";
  element.style.position = "relative";

  element.setAttribute("aria-label", percentValue);

  var barEl = document.createElement("div");
  barEl.style.display = "inline-block";
  barEl.style.position = "relative";
  barEl.style.width = percentValue + "%";
  barEl.style.backgroundColor = color;
  barEl.style.height = "100%";

  barEl.setAttribute("data-max", max);
  barEl.setAttribute("data-min", min);

  if (legend) {
    var legendEl = document.createElement("div");
    legendEl.style.position = "absolute";
    legendEl.style.top = "4px";
    legendEl.style.left = 0;
    legendEl.style.textAlign = legendAlign;
    legendEl.style.width = "100%";
    legendEl.style.color = legendColor;
    legendEl.innerHTML = legend;
  }

  onRendered(function () {
    element.appendChild(barEl);

    if (legend) {
      element.appendChild(legendEl);
    }
  });

  return "";
};

var colorfunc = function (value) {
  if (value < 30) {
    return "green";
  } else if (value < 50) {
    return "blue";
  } else if (value < 70) {
    return "#FFCC00";
  } else {
    return "red";
  }
};
var medalicon = function (value, data, type, params, component) {
  //value - original value of the cell
  //data - the data for the row
  //type - the type of mutation occurring  (data|edit)
  //params - the mutatorParams object from the column definition m
  //component - when the "type" argument is "edit", this contains the cell component for the edited cell, otherwise it is the column component for the column
  var color;
  switch (component._column.field) {
    case "Medals.Bronze":
      color = "#cd7f32";
      break;
    case "Medals.Silver":
      color = "#C0C0C0";
      break;
    case "Medals.Gold":
      color = "#FFD700";
      break;
    default:
      color = "#e5e4e2";
      break;
    // code block
  }
  return (
    '<span style="color:' +
    color +
    '"<i class="fas fa-medal"></i></span> ' +
    value
  );

  //return the new value for the cell data.
};

var lineFormatter = function (cell, formatterParams, onRendered) {
  onRendered(function () {
    //instantiate sparkline after the cell element has been aded to the DOM

    var val_arr = [500];
    var curr_val = cell.getValue();
    for (var key in curr_val) {
      val_arr.push(curr_val[key]); // val1 and etc...
    }

    $(cell.getElement()).sparkline(val_arr, {
      width: "100%",
      type: "line",

      spotRadius: 4,
      spotColor: false,
      minSpotColor: false,
      maxSpotColor: false,
      disableTooltips: false,
      valueSpots: $.range_map({
        ":300": "green",
        "300:500": "blue",
        "501:700": "#FFCC00",
        "701:": "red"
      })
    });
  });
};
function getHyperLink(cellComp, formatterParams, onRendered) {
  var cellData = cellComp.getData();
  var cellValue = cellComp.getValue();

  var hrefString = "https://hackerrank.com/" + cellData.Username;
  var new_uname =
    "<a href='" +
    hrefString +
    "' target='_blank' " +
    "style='color: " +
    colorfunc(cellData.Rating / 10) +
    " !important; font-weight:bold;'" +
    "><strong>" +
    cellValue +
    "</strong></a>";

  return new_uname;
}

